import { Component } from "@angular/core";

@Component({
  selector: "app-register",
  templateUrl: "./register.component.html",
  styleUrls: ["./register.component.css"],
})
export class RegisterComponent {
  onSubmit() {
    fetch("/api/register", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then((data) => {
        console.log(data);
      })
      .catch((error) => {
        console.error("There was a problem with the fetch operation:", error);
      });
  }
}
<div class="style">
  <h2 class="style1">Registeration Page</h2>
  <form (ngSubmit)="onSubmit()" method="POST" enctype="application/json">
    <div class="form-row">
      <div class="form-group col-md-6">
        <label for="Enter Phone Number">Customer Name</label>
        <input type="text" class="form-control" id="Enter Phone Number" />
      </div>
    </div>
    <div class="form-row">
      <div class="form-group col-md-6">
        <label for="inputEmail4">Email</label>
        <input
          type="email"
          class="form-control"
          id="inputEmail4"
          placeholder="Email"
        />
      </div>
      <div class="form-group col-md-6">
        <label for="inputPassword4">Password</label>
        <input
          type="password"
          class="form-control"
          id="inputPassword4"
          placeholder="Password"
        />
      </div>
    </div>
    <div class="form-group">
      <label for="inputAddress">Address</label>
      <input
        type="text"
        class="form-control"
        id="inputAddress"
        placeholder="1234 Main St"
      />
    </div>
    <div class="form-row">
      <div class="form-group col-md-6">
        <label for="Enter Phone Number">Phone Number</label>
        <input type="text" class="form-control" id="Enter Phone Number" />
      </div>
    </div>
    <div class="form-group"></div>
    <button type="submit" class="btn btn-primary">Register</button>
  </form>
</div>
<script>
  var app = angular.module("myApp", []);
  app.controller("myCtrl", function ($scope, $http) {
    $scope.submitRegistration = function () {
      var data = {
        customerName: $scope.customerName,
        email: $scope.email,
        password: $scope.password,
        address: $scope.address,
        phoneNumber: $scope.phoneNumber,
      };
      console.log("HELLO ASDAS");
      $http.post("/api/regissster", data).then(
        function (response) {
          // Handle success response
        },
        function (response) {
          // Handle error response
        }
      );
    };
  });
</script>
